function speedTest(e,t,n){if(document.cookie.indexOf("cs")==-1||t){c(e,function(e){n(e)})}else{n(g("cs"))}}function c(e,t){var n,r;var i=new XMLHttpRequest;n=(new Date).getTime();i.onload=function(e){r=(new Date).getTime();var i=(r-n)/1e3;s=(e.loaded/i/131072).toFixed(2);l(s);t(s)};i.open("GET",e+"?"+n,true);i.send()}function l(e){var t=new Date;var n=t.getTime();if(e<=.75){n+=12e4}else if(e>.75&&e<=1){n+=3e4}else if(e>1&&e<=1.5){n+=1e4}else if(e>1.5&&e<=10){n+=5e3}else if(e>10){n+=1e3}t.setTime(n);document.cookie="cs="+e+";expires="+t.toGMTString()}function g(e){if(document.cookie.length>0){var t=document.cookie.indexOf(e+"=");if(t!=-1){t=t+e.length+1;var n=document.cookie.indexOf(";",t);if(n==-1){n=document.cookie.length}return unescape(document.cookie.substring(t,n))}}return""}